import { Button } from 'react-bootstrap';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

export default function Header(){
    return(
        <>

<Navbar bg="dark" data-bs-theme="dark">
        <Container>
          <Navbar.Brand href="#home">Memes App</Navbar.Brand>
          <Nav className="me-auto">
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="#MovieList">MovieList</Nav.Link>
            <Nav.Link href="Movie">Movie</Nav.Link>
            <Nav.Link href="Navbar">Navbar</Nav.Link>
            <Nav.Link href="ModelMovie">ModelMovie</Nav.Link>
            <Nav.Link href="FavList">FavList</Nav.Link>

          </Nav>
        </Container>
      </Navbar>
      <br />
        </>
    );
}
